import React from 'react';
import ContentBlock from './ContentBlock.js';
import Title from './Title.js';

import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';

function ActionAreaCard(props) {
  return (
    <Card className="chooseCard" style={{margin: "1em"}} sx={{ maxWidth: 345 }}>
      <CardActionArea className="chooseCardArea">
        <CardContent>
          <Typography align="center" variant="body1" color="text.secondary">
            {props.content}
          </Typography>
          <Typography align="center" gutterBottom variant="h5" component="div">
            {props.title}
          </Typography>
        </CardContent>
      </CardActionArea>
    </Card>
  );
}

class ChooseBlock extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <ContentBlock>
        <Title content="Choose fresh ideas to do" />
        <div id="choose_list">
          <ActionAreaCard title="Education" content="Learn how to fold a paper crane" />
          <ActionAreaCard title="Busywork" content="Make a bucket list" />
          <ActionAreaCard title="Relaxation" content="Do something you used to do as a kid" />
          <ActionAreaCard title="Music" content="Listen to your favorite album" />
        </div>
      </ContentBlock>
    )
  }
}

export default ChooseBlock;
